export function Test() {
	const [Stakes, setData] = useState([])

	// Fetch users from the backend
	useEffect(() => {
		fetch('http://localhost:4000/api/Stake')
			.then(res => res.json())
			.then(data => setData(data))
	}, [])
	return (
		<div>
			{Stakes.map(stake => (
				<div>
					<p>stake {stake.id}</p>
				</div>
			))}
		</div>
	)
}
